						"　　东城区东四北大街以西，有一家胡同创意工厂――科技寺。这个市级众创空间孵化器，一年半时间成功孵化了10家上市企业。",
						"　　“通过孵化器，培育‘金种子’。”中关村东城园常务副主任李照宏介绍，东城园现有孵化器13家，年收入达500万元以上的成长性企业共有57家。今年新入孵企业449家，在孵企业新上市13家。在中关村“一区十六园”里，中关村东城园地均产出名列榜首。",
						"　　昨天，笔者走进“科技寺”的办公区，落地窗、矮桌、沙发，不远处是一间咖啡厅，旁边是企业之间共用的会议室。再往里走，是花池，里面铺满了鹅卵石，上面栽种两棵郁郁葱葱的幸福树，四周是木质高桌和高凳。花池旁边，就是工位，一排连着一排，不像写字楼格子间那么封闭，完全是开放式的。",
						"　　“原先这地方是北京电视设备厂的老厂房，老厂房车间高大宽敞，和美国硅谷的办公区很像。”科技寺的总经理唐川说。",
						"　　这个2000平方米的办公区，现在已吸引30家企业入驻。而吸引企业前来的，不仅仅是开放的工作环境。",
						"　　“在这里，做视频能找得到视频企业，招人有猎头公司，能省下不少创业成本。”“呤呤语伴”CEO说。这是一家做中国孩子与外国孩子语言伙伴的APP企业，一年前入驻科技寺。让这名CEO最看重的是在这里可以及时了解到各项政策信息。前不久，在科技寺社区经理的帮助下，“呤呤语伴”向东城区递交了中小企业促进专项政策资金的申请。“要是能申请下来，对企业可是不小的帮助！”",
						"　　“科技寺的社区经理知道众创空间内每家企业在做什么，需求是什么，通过服务对接，让企业发展壮大。”唐川说，3年来科技寺举办了400场对接活动，很多企业找合作伙伴、找资源都是靠像“黑客马拉松”这样的活动实现的。“东城区的各项扶持政策，我们都会第一时间了解，并协助企业申请。”",
						"　　在科技寺的帮助下，喜宝动力已成功在新三板上市。公司从初创时几个人的团队，现已发展到200人的规模。“我喜欢老北京的胡同，一开始创业想找一个院子，后来选择更适合团队发展的胡同创意工厂。”喜宝动力的CEO王梵滔说，“我们曾经在东城申请到一笔60万元的文创基金，这笔钱大大缓解了当时的资金瓶颈。”",
						"　　像这样的新三板上市企业，仅科技寺这一家孵化器，一年半的时间里就孵化出了10家。",
						"　　除科技寺外，东城区还有20余家创意工厂，包括77文创园、人美工厂、亮点55等，吸引了1600余家文化创意企业入驻。",
						"　　昨天闭幕的东城区第十二次党代会提出，东城区将推进“胡同创意工厂”升级改造，加强众创空间建设，形成“小集聚、大融合”的发展布局。“要将高附加值、有特色、成长性好的文化创意企业有机植入胡同空间，让中心城区的每一寸宝贵空间都发挥出最大效用。”东城区相关负责人表示。"
